import React, { useEffect, useState } from "react"

type Data={
    header:string;
    body:string[];
}


const LinkSectionFooter:React.FC =()=>{
    const [data,setData]=useState<Data[]>([])
    useEffect(()=>{
        setData([ {header:"husam",body:[]}])
    },[])
    console.log(data)
    return (
        <div>
            {data[0].header , console.log(data)}
         </div>
     )
}
export default LinkSectionFooter
